import { useState } from "react"
import { useNavigate } from "react-router-dom"
import axios from "axios";

export default function CreateContact() {
    const navigate = useNavigate();
    const [firstName, setFirstName] = useState("");
    const [lastName, setLastName] = useState("");
    const [company, setCompnay] = useState("");
    const [telephone, settelephone] = useState("");
    const [email, setEmail] = useState("");


    // function addContact(e) {
    //     e.preventDefault();
    //     axios.post("http://localhost:3000/create",
    //         {
    //             firstName: firstName,
    //             lastName: lastName,
    //             company: company,
    //             phone: phone,
    //             email: email
    //         })
    //         .then(response => console.log(response))
    //         .catch(err => console.log(err))
    // }

    async function addContact(e) {
        e.preventDefault();
        await fetch("http://localhost:3001/create", {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json'
            },
            body: JSON.stringify({
                firstName: firstName,
                lastName: lastName,
                company: company,
                telephone: telephone,
                email: email
            }),
        });
    }


        return (
            <>
                <nav className="md:w-3/4 m-auto mt-8">
                    <button
                        aria-label="Navigates back to the home page"
                        onClick={() => navigate("/")}
                    >

                        <svg
                            xmlns="http://www.w3.org/2000/svg"
                            height="48px"
                            viewBox="0 0 24 24"
                            width="48px"
                            fill="#000000"
                        >
                            <path d="M0 0h24v24H0v0z" fill="none" />
                            <path d="M20 11H7.83l5.59-5.59L12 4l-8 8 8 8 1.41-1.41L7.83 13H20v-2z" />
                        </svg>
                    </button>
                </nav>
                <h1 className="w-full bg-green-600 text-gray-100 text-center py-4 text-4xl uppercase tracking-wide mt-20 md:w-1/2 max-auto rounded-t-md">
                    Add New Contact
                </h1>
                <form
                    className="grid grid-cols-2 md:w-1/2 mx-auto shadow-2xl rounded-md p-8"
                    onSubmit={(e) => addContact(e)}
                >
                    {/* first name */}
                    <div className="w-full px-3 mb-6 md:mb-4">
                        <label
                            htmlFor="firstName"
                            className="block uppercase tracking-wide text-grey-700 text-sm font-bold mb-2">
                            <strong className="text-red-400">*</strong>First Name:</label>
                        <input
                            type="text"
                            id="firstName"
                            required
                            onChange={(e) => setFirstName(e.target.value)}
                            className="appearance-non block w-full bg-gray-200 text-gray-700 border border-gray-200 rounded py-3 px-4 leading-tight focus:outline-non focus:bg-white focus:border-gray-500"
                        />
                    </div>
                    {/* last name */}
                    <div className="w-full px-3">
                        <label
                            htmlFor="lastName"
                            className="block uppercase tracking-wide text-grey-700 text-sm font-bold mb-2">
                            <strong className="text-red-400">*</strong>Last Name:</label>

                        <input
                            type="text"
                            id="lastName"
                            required
                            onChange={(e) => setLastName(e.target.value)}
                            className="appearance-non block w-full bg-gray-200 text-gray-700 border border-gray-200 rounded py-3 px-4 leading-tight focus:outline-non focus:bg-white focus:border-gray-500"
                        />
                    </div>
                    {/* company */}
                    <div className="w-full px-3">
                        <label
                            htmlFor="company"
                            className="block uppercase tracking-wide text-grey-700 text-sm font-bold mb-2">
                            <strong className="text-red-400">*</strong>company:</label>

                        <input
                            type="text"
                            id="company"
                            required
                            onChange={(e) => setCompnay(e.target.value)}
                            className="appearance-non block w-full bg-gray-200 text-gray-700 border border-gray-200 rounded py-3 px-4 leading-tight focus:outline-non focus:bg-white focus:border-gray-500"
                        />
                    </div>
                    {/* phone number */}
                    <div className="w-full px-3">
                        <label
                            htmlFor="telephone"
                            className="block uppercase tracking-wide text-grey-700 text-sm font-bold mb-2">
                            <strong className="text-red-400">*</strong>Phone Number:</label>

                        <input
                            type="text"
                            id="telephone"
                            required
                            onChange={(e) => settelephone(e.target.value)}
                            className="appearance-non block w-full bg-gray-200 text-gray-700 border border-gray-200 rounded py-3 px-4 leading-tight focus:outline-non focus:bg-white focus:border-gray-500"
                        />
                    </div>

                    {/* email address */}
                    <div className="w-full px-3">
                        <label
                            htmlFor="email"
                            className="block uppercase tracking-wide text-grey-700 text-sm font-bold mb-2">
                            <strong className="text-red-400">*</strong>Email:</label>

                        <input
                            type="text"
                            id="email"
                            required
                            onChange={(e) => setEmail(e.target.value)}
                            className="appearance-non block w-full bg-gray-200 text-gray-700 border border-gray-200 rounded py-3 px-4 leading-tight focus:outline-non focus:bg-white focus:border-gray-500"
                        />
                    </div>

                    <button
                        type="submit"
                        className="my-10 col-span-full text-lg border-2 text-gray-100 border-green-600 bg-green-600 hover:bg-gray-50 hover:border-green-600 hover:shadow-2xl lg:w-2/5 justify-self-center rounded-full py-3 px-4 shadow-lg"
                    > Add Contact </button>
                </form>
            </>
        )
    }
